import React, { Component } from 'react'
import Register from './registerModal'
import { Paper, Button } from '@material-ui/core'

class RegisterMain extends Component{

    state = {
        showRegisterFlow: false
    }

    render(){

        let welcomeStyle = {textAlign: 'center'}
        let bodyStyle = {backgroundColor: '#333', marginTop: '50px'}
        let buttonStyle = {marginLeft: '30px', marginRight: '30px'}

        let welcome = 
        <div style={welcomeStyle}>
            <div style={bodyStyle}>
                <Button style={buttonStyle} onClick={() => {this.setState({showRegisterFlow: true})}}>Register a Parent Plate</Button>
                <Button style={buttonStyle} onClick={() => {this.setState({showRegisterFlow: true})}}>Register a High Risk Plate</Button>
            </div>
        </div>

        let current = this.state.showRegisterFlow ? <Register/> : welcome

        return(
            <div style={{height: '650px', width: '100%', backgroundColor: '#333'}}>
                {current}
            </div>
        )
    }

}

export default RegisterMain
